precision mediump float;
uniform sampler2D Ytex;
uniform sampler2D Utex,Vtex;
varying vec2 vTextureCoord;
void main(void) {
  float nx,ny,r,g,b,y,u,v;
  mediump vec4 txl,ux,vx;  nx=vTextureCoord[0];
  ny=vTextureCoord[1];
  y=texture2D(Ytex,vec2(nx,ny)).r;
  u=texture2D(Utex,vec2(nx,ny)).r;
  v=texture2D(Vtex,vec2(nx,ny)).r;
  y=1.1643*(y-0.0625);
  u=u-0.5;
  v=v-0.5;
  r=y+1.5958*v;
  g=y-0.39173*u-0.81290*v;
  b=y+2.017*u;
  gl_FragColor=vec4(r,g,b,1.0);
}

varying vec2 interp_tc;
attribute vec4 in_pos;
attribute vec4 in_tc;

uniform mat4 texMatrix;

void main() {
    gl_Position = in_pos;
    interp_tc = (texMatrix * in_tc).xy;
}

varying vec2 tc;
attribute vec4 in_pos;
attribute vec4 in_tc;
uniform mat4 tex_mat;
void main() {
  gl_Position = in_pos;
  tc = (tex_mat * in_tc).xy;
}

precision mediump float;
varying vec2 interp_tc_y;
varying vec2 interp_tc_u;
varying vec2 interp_tc_v;
uniform sampler2D y_tex;
uniform sampler2D u_tex;
uniform sampler2D v_tex;
uniform mat3 mColorConversion;
void main() {
  vec3 yuv;
  yuv.x = texture2D(y_tex, interp_tc_y).r - 0.0625;
  yuv.y = texture2D(u_tex, interp_tc_u).r - 0.5;
  yuv.z = texture2D(v_tex, interp_tc_v).r - 0.5;
  gl_FragColor = vec4(mColorConversion * yuv, 1.0);
}

uniform mat4 uMvpMatrix;
uniform mat3 uTexMatrix;
attribute vec4 aPosition;
attribute vec2 aTexCoords;
varying vec2 vTexCoords;
// Standard transformation.
void main() {
  gl_Position = uMvpMatrix * aPosition;
  vTexCoords = (uTexMatrix * vec3(aTexCoords, 1)).xy;
}

uniform mat4 uMVPMatrix;attribute vec4 aPosition;
attribute vec2 aTextureCoord;
varying vec2 vTextureCoord;
void main() {
  gl_Position = uMVPMatrix * aPosition;
  vTextureCoord = aTextureCoord;
}

varying vec2 interp_tc_y;
varying vec2 interp_tc_u;
varying vec2 interp_tc_v;
attribute vec4 in_pos;
attribute vec2 in_tc_y;
attribute vec2 in_tc_u;
attribute vec2 in_tc_v;
void main() {
  gl_Position = in_pos;
  interp_tc_y = in_tc_y;
  interp_tc_u = in_tc_u;
  interp_tc_v = in_tc_v;
}

uniform vec2 xUnit;
uniform vec4 coeffs;

void main() {
  gl_FragColor.r = coeffs.a + dot(coeffs.rgb,
      sample(tc - 1.5 * xUnit).rgb);
  gl_FragColor.g = coeffs.a + dot(coeffs.rgb,
      sample(tc - 0.5 * xUnit).rgb);
  gl_FragColor.b = coeffs.a + dot(coeffs.rgb,
      sample(tc + 0.5 * xUnit).rgb);
  gl_FragColor.a = coeffs.a + dot(coeffs.rgb,
      sample(tc + 1.5 * xUnit).rgb);
}
